import './css/App.css';
import Forza4 from './component/Forza4/Forza4';
import Tris from './component/Tris/Tris';
import {Router, Link, Switch, Route, NavLink, HashRouter} from "react-router-dom";

function App() {
  return (
    <div>
      <BrowserRouter>
        <div>
          <h1>Giochi in React</h1>
          <ul className="header">
            <li><Link to="/">Home</Link></li>
            <li><Link to="/tris">Tris</Link></li>
            
          </ul>
          <div className="content">
            <Switch>
              <Route path="/"> <Forza4/> </Route>
              <Route path="/tris"> <Tris/> </Route>

            </Switch>
            
            
          </div>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
